import React from 'react';
import './App.css';
import{Home} from './Home';
import {Cadastro} from './Cadastro';
import {AtualizarFuncionario} from './AtualizarFuncionario';
import {BrowserRouter, Route, Routes, NavLink} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className="App container">
      <h3 className = "d-flex justify-content-center m-3">
        React JS front_end
      </h3>

    <nav className='navbar navbar-expand-sm bg-light navbar-dark'>
      <ul className='navbar-nav'>
        <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/Home'> 
            Home
          </NavLink>

        </li>
        <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/Cadastro'> 
            Cadastro
          </NavLink>

        </li>
        <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/AtualizarFuncionario'> 
            Atualizar Funcionario
          </NavLink>

        </li>

      </ul>

    </nav>

      <Route path='/Home' componet = {<Home/>} />
      <Route path='/Cadastro' componet = {<Cadastro/>} />
      <Route path='/AtualizarFuncionario' componet = {<AtualizarFuncionario/>} />
    </div>

    </BrowserRouter>
  );
}

export default App;
